// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/Ownable.sol";

contract PredictionMarket is Ownable {
    // Define a Market structure to hold market details
    struct Market {
        string question;         // The question or event being predicted
        uint256 resolutionTime;  // Timestamp when the market can be resolved
        bool resolved;           // Whether the market is resolved
        bool outcome;            // Final outcome (true/false)
    }

    // Define a Bet structure to track user bets
    struct Bet {
        address user;            // Address of the bettor
        uint256 amount;          // Amount of ETH bet
        bool prediction;         // Predicted outcome (true/false)
    }

    // Mappings to store markets and bets
    mapping(uint256 => Market) public markets;
    mapping(uint256 => Bet[]) public marketBets;
    uint256 public marketCount;  // Tracks the number of markets

    // Events for logging actions
    event MarketCreated(uint256 marketId, string question, uint256 resolutionTime);
    event BetPlaced(uint256 marketId, address user, uint256 amount, bool prediction);
    event MarketResolved(uint256 marketId, bool outcome);

    // Constructor sets the contract deployer as the owner
    constructor() Ownable(msg.sender) {}

    // Create a new prediction market
    function createMarket(string memory _question, uint256 _resolutionTime) external onlyOwner {
        require(_resolutionTime > block.timestamp, "Resolution time must be in the future");

        marketCount++;
        markets[marketCount] = Market({
            question: _question,
            resolutionTime: _resolutionTime,
            resolved: false,
            outcome: false // Default value, updated upon resolution
        });

        emit MarketCreated(marketCount, _question, _resolutionTime);
    }

    // Place a bet on a market
    function placeBet(uint256 _marketId, bool _prediction) external payable {
        require(_marketId > 0 && _marketId <= marketCount, "Invalid market ID");
        require(msg.value > 0, "Must place a bet with value");
        require(block.timestamp < markets[_marketId].resolutionTime, "Betting period has ended");
        require(!markets[_marketId].resolved, "Market already resolved");

        marketBets[_marketId].push(Bet({
            user: msg.sender,
            amount: msg.value,
            prediction: _prediction
        }));

        emit BetPlaced(_marketId, msg.sender, msg.value, _prediction);
    }

    // Resolve a market and distribute rewards
    function resolveMarket(uint256 _marketId, bool _outcome) external onlyOwner {
        require(_marketId > 0 && _marketId <= marketCount, "Invalid market ID");
        require(block.timestamp >= markets[_marketId].resolutionTime, "Too early to resolve");
        require(!markets[_marketId].resolved, "Market already resolved");

        markets[_marketId].resolved = true;
        markets[_marketId].outcome = _outcome;

        distributeRewards(_marketId, _outcome);
        emit MarketResolved(_marketId, _outcome);
    }

    // Distribute rewards to winners
    function distributeRewards(uint256 _marketId, bool _outcome) private {
        Bet[] storage bets = marketBets[_marketId];
        uint256 totalPool = 0;    // Total ETH bet on the market
        uint256 winningPool = 0;  // Total ETH bet on the winning outcome

        // Calculate total and winning pools
        for (uint256 i = 0; i < bets.length; i++) {
            totalPool += bets[i].amount;
            if (bets[i].prediction == _outcome) {
                winningPool += bets[i].amount;
            }
        }

        // Distribute rewards to winners
        if (winningPool > 0) {
            for (uint256 i = 0; i < bets.length; i++) {
                if (bets[i].prediction == _outcome) {
                    uint256 reward = (bets[i].amount * totalPool) / winningPool;
                    payable(bets[i].user).transfer(reward);
                }
            }
        }
    }
}

